import{_ as l,a as i}from"./chunks/spracingh7extreme-bottom.BnLJSNNC.js";import{_ as e,c as r,o as a,ab as t}from"./chunks/framework.CUflZczI.js";const f=JSON.parse('{"title":"SPRacingH7EXTREME (Версія PX4)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/spracingh7extreme.md","filePath":"uk/flight_controller/spracingh7extreme.md"}'),o={name:"uk/flight_controller/spracingh7extreme.md"},s=t('<h1 id="spracingh7extreme-версія-px4" tabindex="-1">SPRacingH7EXTREME (Версія PX4) <a class="header-anchor" href="#spracingh7extreme-версія-px4" aria-label="Permalink to &quot;SPRacingH7EXTREME (Версія PX4)&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">PX4 не виробляє цей (або будь-який) автопілот. Зверніться до <a href="https://shop.seriouslypro.com" target="_blank" rel="noreferrer">виробника</a> щодо підтримки апаратного забезпечення чи відповідності вимогам. :::</p><p><a href="https://shop.seriouslypro.com/sp-racing-h7-extreme" target="_blank" rel="noreferrer">SPRacingH7EXTREME</a> - це функціонально навантажене FC/PDB з подвійними гіроскопами ICM20602, процесором H7 400/480МГц(+), високоточним барометром BMP388, роз&#39;ємом для SD-карти, датчиком струму, 8 легко доступними виходами для двигунів, OSD, мікрофоном, аудіовиходом та багато іншого.</p><p>Це може бути легко використовувати для невеликих і великих квадрокоптерів, літаків, восьмикоптерів та більш розвинених конструкцій. Найкраще використовувати з окремими ESC, оскільки він має вбудовану плату розподілу живлення (PDB). Підключення 4in1 ESC також легко.</p><p>Також є 12-контактний стековий роз’єм, який забезпечує ще 4 виходи двигуна, підключення SPI та UART.</p><p><img src="'+l+'" alt="SPRacingH7EXTREME PCB Top"></p><p><img src="'+i+'" alt="SPRacingH7EXTREME PCB Bottom"></p><div class="info custom-block"><p class="custom-block-title">Цей польотний контролер <a href="./../flight_controller/autopilot_manufacturer_supported.html">підтримується виробником</a>. :::</p><h2 id="основні-характеристики" tabindex="-1">Основні характеристики <a class="header-anchor" href="#основні-характеристики" aria-label="Permalink to &quot;Основні характеристики&quot;">​</a></h2><ul><li>Основна System-on-Chip: <a href="https://www.st.com/en/microcontrollers-microprocessors/stm32h750vb.html" target="_blank" rel="noreferrer">STM32H750VBT6 rev.y/v</a><ul><li>CPU: 400/480Mhz(+) ARM Cortex M7 з одинарною точністю FPU. (+ 480МГц з процесорами Rev V)</li><li>RAM: 1MB</li><li>16MB External Flash 4-bit QuadSPI в режимі Memory Mapped для коду <em>та</em> конфігурації.</li></ul></li><li>Бортові сенсори: <ul><li>Dual Gyros (1xSPI кожен, з окремими сигналами переривань, 32khz capable, fsync capable)</li><li>Високоточний барометр BMP388 (I2C + переривання)</li><li>Датчик струму 110A</li></ul></li><li>GPS через зовнішній 8-контактний IO порт.</li><li>Audio/Visual <ul><li>On-screen display OSD (dedicated SPI, character based, MAX7456)</li><li>Датчик мікрофона</li><li>Аудіо вивід з CPU DAC.</li><li>Аудіо мікшер для виводів мікрофона/DAC.</li></ul></li><li>Інтерфейси <ul><li>SD Card (4-bit SDIO not 1-bit SPI)</li><li>Інфрачервоний транспондер (сумісний з iLAP)</li><li>Buzzer circuitry</li><li>RSSI (Analog/PWM)</li><li>12 motor outputs (4 by motor pads, 4 in the middle, and 4 on stacking connector).</li><li>1x SPI breakout onto stacking connector</li><li>6 послідовних портів (5x TX та RX, 1x TX-only двосторонній для телеметрії)</li><li>Кнопка запуску (Натиск з боку)</li><li>Bind/User кнопка (Бічний натиск)</li><li>Порти ресивера (усі звичайні протоколи, без потреби в інверторі)</li><li>CAM OSD control and Video IN on CAM socket.</li><li>SWD debugging port.</li></ul></li><li>Video OUT + Audio OUT on VTX socket.</li><li>USB з можливістю OTG (ID та VBUS з&#39;єднані з CPU)</li><li>Система живлення <ul><li>Інтегрований PDB.</li><li>2-6S BEC</li><li>Телевізійний захистний діод</li><li>Призначений 500ma VREG для гіроскопів, з конденсаторами для фільтрації шуму гіроскопа.</li><li>Другий 500 мА VREG для ЦП, барометра, мікрофону тощо.</li></ul></li><li>Інші характеристики <ul><li>LED-статус</li><li>Підтримка світлодіодної стрічки (з добре розташованими підключеннями).</li><li>Запуск з картки SD або зовнішнього флеш-накопичувача.</li><li>Прошивка з SD карти.</li><li>Дизайн з припаями зверху.</li><li>Вирізи на платах друкованих плат для дротів батарей.</li><li>Немає компаса, використовуйте зовнішній GPS з магнітометром/компасним датчиком, підключеним до порту GPS IO.</li><li>Також працює з Betaflight 4.x +, Cleanflight 4.x +.</li><li>Розроблено Домініком Кліфтоном, хлопцем, що створив Cleanflight</li></ul></li><li>Розміри <ul><li>36x36 мм із зразком кріплення 30.5*30.5, отвори M4.</li><li>Втулки з м’яким кріпленням від M4 до M3 постачаються.</li></ul></li></ul><h2 id="де-придбати" tabindex="-1">Де придбати <a class="header-anchor" href="#де-придбати" aria-label="Permalink to &quot;Де придбати&quot;">​</a></h2><p>SPRacingH7EXTREME доступний у магазині <a href="https://shop.seriouslypro.com/sp-racing-h7-extreme" target="_blank" rel="noreferrer">Seriously Pro shop</a>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Виберіть видання PX4 при покупці!</p></div></div></div><h2 id="керівництво-pinouts-та-схеми-підключення" tabindex="-1">Керівництво, Pinouts та Схеми підключення <a class="header-anchor" href="#керівництво-pinouts-та-схеми-підключення" aria-label="Permalink to &quot;Керівництво, Pinouts та Схеми підключення&quot;">​</a></h2><p>Інструкцію з розпиновками можна завантажити <a href="http://seriouslypro.com/files/SPRacingH7EXTREME-Manual-latest.pdf" target="_blank" rel="noreferrer">тут</a>. Дивіться веб-сайт <a href="http://seriouslypro.com/spracingh7extreme" target="_blank" rel="noreferrer">SPRacingH7EXTREME</a> для інших діаграм.</p><h2 id="автори" tabindex="-1">Автори <a class="header-anchor" href="#автори" aria-label="Permalink to &quot;Автори&quot;">​</a></h2><p>Цей дизайн був створений <a href="https://github.com/hydra" target="_blank" rel="noreferrer">Домініком Кліфтоном</a> Початкова підтримка PX4 від <a href="https://github.com/Igor-Misic" target="_blank" rel="noreferrer">Ігоря Місіча</a></p>',6),n=[s];function c(p,h,u,m,d,P){return a(),r("div",null,n)}const S=e(o,[["render",c]]);export{f as __pageData,S as default};
